import './App.css';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
//main color rgb(35 36 44);
//box color rgb(57 58 66)

function App() {

  return (
    <div className="App">


    <div className='box'>

    <Box component="span" sx={{ p: 2, border: '1px dashed grey' }}>
      <Button>Save</Button>
    </Box>
    </div>

    </div>
  );
}

export default App;
